import React from 'react';
import '../Filecss/Team.css'

const TeamShowcase = () => {
    return (
        <div className="container">
            <div className="row">
                <TeamMember
                    imgSrc="https://images.pexels.com/photos/157646/title-photo-logo-shirt-157646.jpeg?w=940&h=650&auto=compress&cs=tinysrgb"
                    name="Peter Johns"
                    role="Web Developer"
                />
                <TeamMember
                    imgSrc="https://static.pexels.com/photos/38554/girl-people-landscape-sun-38554.jpeg"
                    name="Kelli Smith"
                    role="Web Developer"
                />
                <TeamMember
                    imgSrc="https://images.pexels.com/photos/157646/title-photo-logo-shirt-157646.jpeg?w=940&h=650&auto=compress&cs=tinysrgb"
                    name="Peter Johns"
                    role="Web Developer"
                />
            </div>
        </div>
    );
};

const TeamMember = ({ imgSrc, name, role }) => {
    return (
        <div className="col-md-4 col-sm-6">
            <div className="our-team">
                <div className="pic">
                    <img src={imgSrc} alt="team member" className="img-responsive" />
                </div>
                <div className="content">
                    <h3 className="title">{name}</h3>
                    <span className="post">{role}</span>
                    <ul className="social">
                        <li><a href="#" className="fa fa-facebook"></a></li>
                        <li><a href="#" className="fa fa-twitter"></a></li>
                        <li><a href="#" className="fa fa-linkedin"></a></li>
                    </ul>
                </div>
            </div>
        </div>
    );
};

export default TeamShowcase;
